Man Who Came Back, The (2008)  

Verenigde Staten
Drama / Western
112 minuten

geregisseerd door Glen Pitre
met Billy Zane, Sean Young en George Kennedy

Wanneer voormalige slaven in staking gaan op de plantage van rechter Duke, breekt de hel los. De wet, in vorm van Amos en Ezra, heeft Duke in zijn zak. Reese Paxton, een blanke grondbezitter, kiest de zijde van de slaven en daardoor begint er een opeenvolging van gebeurtenissen waardoor Paxton zijn familie moet verlaten en in de cel belandt en de slaven overgelaten worden aan de grillen van Ezra's bende. Velen worden gedood, inclusief de vrouw en de zoon van Paxton. Als deze laatste vrijkomt, wil hij snel wraak nemen en nu krijgt hij de hulp van de voormalige slaven.

